var formattedEvents = [];
var eventObj = {};

 var eventHeader = events.eventHeaders;
if(eventHeader['x-wc-webhook-resource']!==undefined)
{
  var resource=eventHeader['x-wc-webhook-resource'];


  var eventBody=events[resource];

  if (eventHeader['x-wc-webhook-event'] === 'created')
  eventObj.event_type = "CREATED";
  else if(eventHeader['x-wc-webhook-event'] === 'updated')
  eventObj.event_type = "UPDATED";
  else if(eventHeader['x-wc-webhook-event'] === 'deleted')
  eventObj.event_type = "DELETED";
  else
  eventObj.event_type= "UNKNOWN";

  eventObj.event_object_id = eventHeader['x-wc-webhook-id'];

  if(resource==="coupon")
  eventObj.event_object_type="discount";
  else
  eventObj.event_object_type = resource;

formattedEvents.push(eventObj);
done({
  "events": formattedEvents
});
}else{
 var resource=events.objectType;
 var eventBody=events[resource];
 for(var arrayItem=0; arrayItem < eventBody.length; arrayItem++){
 eventObj.event_type=eventBody[arrayItem].eventType;
 eventObj.event_object_type=resource;
 eventObj.event_object_id=eventBody[arrayItem].objectId;
 eventObj.event_date=eventBody[arrayItem].date_modified;
 formattedEvents.push(eventObj);
}
done({
  "events": formattedEvents
});
}
